var tipuesearch = {"pages":[{"title":"About","text":"cd2022 課程倉儲: https://40923148.github.io/cd2022_ag3/content/index.html wink: https://40923148.github.io/cd2022_ag3/content/40923148.html 課程投影片: https://docs.google.com/presentation/d/1OmtvOYHHmfGw1GtU6z9o25VLzuFiu87PU_-RFUqMWd0/edit#slide=id.g11a75997653_2_130 Title: w6_40923148 Datae:2022-03-29 11:00 w6_40923148 課程倉儲: https://github.com/chiamingyen/cmsimfly 內容管理: https://chiamingyen.github.io/cmsimfly/ 課程投影片: https://chiamingyen.github.io/cmsimfly/reveal 課程網誌: https://chiamingyen.github.io/cmsimfly/blog","tags":"misc","url":"./pages/about/"},{"title":"w10_nx_integ","text":"test","tags":"Misc","url":"./w10_nx_integ.html"},{"title":"w7_summary","text":"進度 在隨身軟體clone scarysim並依照老師步驟開啟scarysim.exe 並嘗試更改參數使得零件間無法造成干涉。 分工 指定組員分別利用 Solvespace、NX12、NX1980、NX2008 與 Onshape 繪製 Pick and Place demo 範例所需的零組件, 並完成 Coppeliasim 4.1.0、4.2.0 與 4.3.0 版的 MTB 機械手臂 Pick and Place 模擬, 完成後請說明在使用不同 MCAD 系統與版次的情況下, 該如何執行協同產品設計專案. Deliverables 1.各組組員以 Pelican 網誌 (w7_pick_and_place.html) 及 Reveal.js 簡報紀錄個人所完成的內容. 2.各大組以 Pelican 網誌 (w7_pick_and_place.html) 及 Reveal.js 簡報摘要各大組任務執行結果. 3.各大組將所有完成的程式碼、編譯結果、MCAD 零組件檔案以及場景模擬檔案壓縮為 .7z (以 2ag1 大分組為例, 檔案名稱設為w7_pap_cd2022ag1.7z) 後, 送到組長的 @gm 帳號下的 OneDrive 共享區, 設定為只有 @gm 帳號登入者可以下載的共用權限後, 將連結發布在大組的 Pelican 網誌中. 4.各大組以程式方法執行上述任務的量化查驗後, 結合組員自評與互評流程後, 將各組員的評量結果存為 w7_cd2022ag1_evaluation.txt (以 2ag1 為例), 採允許各組組員與 yen@gm 共享下載進行設定.","tags":"Misc","url":"./w7_summary.html"},{"title":"w6","text":"W1 先進行四人一小組8人一大組的分組創 分組倉儲 。 w2 分配28部影片回家製作 WINK 。 w3 製作PPT與組別內討論跟 PPT 組合。 w4 NX1980操作演示與介紹 課程倉儲: https://40923148.github.io/cd2022_ag3/content/index.html wink: https://40923148.github.io/cd2022_ag3/content/40923148.html 課程投影片: https://docs.google.com/presentation/d/1OmtvOYHHmfGw1GtU6z9o25VLzuFiu87PU_-RFUqMWd0/edit#slide=id.g11a75997653_2_130","tags":"Misc","url":"./w6_40923148.html"}]};